script: |
  super -f text -I q6330.spq | sort > q6330.out

inputs:
  - name: q6330.spq
    data: |
      SELECT DISTINCT + col2 AS col0 FROM tab1 (FORMAT parquet) WHERE NOT - col2 * + 69 * 55 IS NOT NULL AND ( + - col2 ) + + 63 NOT IN ( + col2, + ( col1 ) + - ( - - 41 ), - col0 );
  - name: tab1

outputs:
  - name: q6330.out
    data: |
